import VerticalMenu from './VerticalMenu';
import './App.css';
import Chart from './Chart';


function Analysis() {
  
  return (
    <div id="Analysis">
      <h1 className="chart-header">Sentimental Analysis Chart</h1>
      
      <Chart/>
      <Dislay/>
      <VerticalMenu />
      
    </div>
  );
}

export default Analysis;
